import L from "leaflet";
import {MapContainer,Marker,TileLayer,Popup} from "react-leaflet"
import MarkIcon from "leaflet/dist/images/marker-icon.png"
import "react-leaflet-routing-machine";
import { useEffect, useState } from "react";

const App=()=>{
const[currentPosition,setCurrent]=useState(null);
  useEffect(()=>{
    navigator.geolocation.watchPosition((postition)=>{
      const{lati,longi}=postition.coords;
      setCurrent([lati,longi])
    },(err)=>{
      console.log("error ....")
    },{enableHighAccuracy:true})
  },[currentPosition])

  return (

    <>
    <MapContainer center={currentPosition} zoom={20} style={{height:"100vh",width:"100vw"}} >
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'></TileLayer>
      <Marker position={currentPosition}></Marker>
    </MapContainer>
    </>
  )
}

export default App;
